import React from 'react'
import {Avatar} from '@material-ui/core'

function Post({
    displayName,
    username, 
    verified,
    text,
    image, 
    avatar
}) {
    return (
        <div className="post">
            <div className="post_avatar">
                <Avatar src="https://poster.keepcalmandposters.com/7568213.jpg" />
            </div>
        </div>
    )
}

export default Post
